description:
Story of Jesus Shuttlesworth, the most sought after high 
school basketball prospect in the nation. Jesus and his dream 
to make it to the big ranks in professional basketball are 
overshadowed by his father, Jake, who is spending his life in 
prison for killing Jesus' mother.
   Jake Shuttlesworth is in prison serving time for killing 
his wife in a violent family feud. He is released on parole, 
but with one condition - he must persuade his son, genius 
basketball player Jesus to sign with the governor's alma mater 
university, Big State. And Jake only has a week to do it.

